using System;
using System.Drawing;
using System.Drawing.Imaging;
using System.IO;

namespace SolutionValidator
{
    internal class SolutionTester
    {
        private readonly ImageClient imageClient;

        public SolutionTester(string url)
        {
            imageClient = new ImageClient(url);
        }

        public void Test()
        {
            TestOne("55,75,70,70", "rotate-cw", ZebraRotateCw);
            TestOne("45,105,70,70", "rotate-ccw", ZebraRotateCcw);
            TestOne("105,45,70,70", "flip-h", ZebraFlipH);
            TestOne("75,55,70,70", "flip-v", ZebraFlipV);

            Console.WriteLine("The solution has passed basic correctness tests.");
        }

        private void TestOne(string coords, string transform, string expectedImage)
        {
            if (!AreImagesEqual(imageClient.ProcessImage(@"External\zebra.png", coords, transform), Convert.FromBase64String(expectedImage)))
                throw new Exception($"The solution incorrectly handles '{transform}' transform.");
        }

        private static unsafe bool AreImagesEqual(byte[] img1, byte[] img2)
        {
            if (img1 == null || img2 == null)
                return false;

            var equal = true;
            try
            {
                var bmp1 = Image.FromStream(new MemoryStream(img1)) as Bitmap;
                var bmp2 = Image.FromStream(new MemoryStream(img2)) as Bitmap;

                if (bmp1 == null || bmp2 == null || bmp1.Size != bmp2.Size)
                {
                    SaveMismatch(img1);
                    return false;
                }

                var inputBits = bmp1.LockBits(new Rectangle(0, 0, bmp1.Width, bmp1.Height), ImageLockMode.ReadOnly, PixelFormat.Format32bppArgb);
                var outputBits = bmp2.LockBits(new Rectangle(0, 0, bmp2.Width, bmp2.Height), ImageLockMode.ReadOnly, PixelFormat.Format32bppArgb);

                uint* src = (uint*)inputBits.Scan0;
                uint* dest = (uint*)outputBits.Scan0;

                for (int i = 0; i < bmp1.Width * bmp1.Height; i++)
                {
                    if (src[i] != dest[i])
                    {
                        equal = false;
                        break;
                    }
                }

                bmp1.UnlockBits(inputBits);
                bmp2.UnlockBits(outputBits);
            }
            catch (Exception e)
            {
                Console.WriteLine(e);
                equal = false;
            }

            if (!equal)
                SaveMismatch(img1);

            return equal;
        }

        private static void SaveMismatch(byte[] img1)
        {
            File.WriteAllBytes("mismatch." + Guid.NewGuid() + ".png", img1);
        }

        private const string ZebraFlipH = "";
        private const string ZebraFlipV = "";
        private const string ZebraRotateCcw = "";
        private const string ZebraRotateCw = "";
    }
}